import React, { Fragment } from 'react';
import { colors } from "./constants";
import styles from './Paint.module.css';

const colorPallete =colors.for(color => <div className={styles.colorButton} style={{backgroundColor:{color}}}></div>)

const Paint = () => {
    return(
        <Fragment>
            <canvas id={styles.canvas} width ="600" height="600"/>
            {colorPallete}
            <button id="clear">Очистить изображение</button>
            <button id="save" > Сохранить</button> 
        </Fragment>
    )
};
export default Paint;
